  "codeLabFeaturedProject_HotPotato.projectName" : {
    "translation" : "Patate chaude"
  },
  "codeLabFeaturedProject_HotPotato.projectDescription" : {
    "translation" : "Lorsque la musique s'arrête, ne reste pas bloqué avec la patate chaude !"
  },
  "codeLabFeaturedProject_HotPotato.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Ce jeu se joue à deux, plus Cozmo. \u000a\u000a<span style='font-weight:bold;'>2.</span> Le petit robot te demande de <span style='font-weight:bold;'>placer un cube sous son bras élévateur</span> afin qu'il puisse taper dessus.\u000a\u000a<span style='font-weight:bold;'>3.</span> Dans ce jeu, les voyants du cube représentent la patate. Lorsque tu la reçois, ils deviennent d'abord <span style='color:#ff0000'>rouges</span>, puis <span style='color:#00ff00'>verts</span> pour te signaler que tu peux la passer à ton voisin en <span style='font-weight:bold;'>tapant</span> sur le cube.\u000a\u000a<span style='font-weight:bold;'>4.</span> Attention à ne plus l'avoir en mains quand la musique s'arrête !"
  },
  "codeLabFeaturedProject_TinyOrchestra.projectName" : {
    "translation" : "Petit orchestre"
  },
  "codeLabFeaturedProject_TinyOrchestra.projectDescription" : {
    "translation" : "C'est ton propre petit orchestre et les cubes sont tes instruments !"
  },
  "codeLabFeaturedProject_TinyOrchestra.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Avant toute chose, vérifie que le son de ton appareil est assez fort.\u000a\u000a<span style='font-weight:bold;'>2.</span> <span style='font-weight:bold;'>Place</span> 3 cubes devant Cozmo.\u000a\u000a<span style='font-weight:bold;'>3.</span> Lorsque tu démarres le jeu, les voyants des cubes affichent tour à tour différentes couleurs. <span style='font-weight:bold;'>Tape</span> sur un cube pour jouer de son instrument. <span style='font-weight:bold;'>Tape</span> dessus une nouvelle fois pour en changer.\u000a\u000a<span style='font-weight:bold;'>4.</span> Teste les différentes musiques que tu peux faire !"
  },
  "codeLabFeaturedProject_MagicFortuneTeller.projectName" : {
    "translation" : "Voyant magique !"
  },
  "codeLabFeaturedProject_MagicFortuneTeller.projectDescription" : {
    "translation" : "Secoue Cozmo pour connaître ton avenir."
  },
  "codeLabFeaturedProject_MagicFortuneTeller.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Lorsque tu appuies sur le drapeau de départ, un point d'interrogation apparaît sur le visage de Cozmo. C'est alors à toi de lui poser une question à laquelle il devra répondre par oui ou par non.\u000a\u000a<span style='font-weight:bold;'>2.</span> <span style='font-weight:bold;'>Secoue-le</span> ensuite pour qu'il te dise la bonne aventure !\u000a\u000a<hr style='background-color:#bbb; color:#bbb; border:none; height:1px'><span style='font-size:80%; font-color:#ddd'>Ce jeu ne nécessite aucun cube.</span>"
  },
  "codeLabFeaturedProject_CubeWhack.projectName" : {
    "translation" : "Frappe de cube"
  },
  "codeLabFeaturedProject_CubeWhack.projectDescription" : {
    "translation" : "Frappe ce cube ! Quel est ton meilleur score ?"
  },
  "codeLabFeaturedProject_CubeWhack.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Avant de commencer, <span style='font-weight:bold;'>place</span> 3 cubes devant Cozmo.\u000a\u000a<span style='font-weight:bold;'>2.</span> Ses voyants dorsaux s'illuminent alors. <span style='font-weight:bold;'>Tape</span> rapidement sur le cube dont la couleur correspond.\u000a\u000a<span style='font-weight:bold;'>3.</span> <span style='font-weight:bold;'>Tape</span> sur autant de cubes que possible avant que le délai ne soit écoulé !\u000a\u000a<span style='font-weight:bold;'>4.</span> Peux-tu battre ton score le plus élevé ?"
  },
  "codeLabFeaturedProject_FiretruckAlarm.projectName" : {
    "translation" : "Minuteur de Cozmo"
  },
  "codeLabFeaturedProject_FiretruckAlarm.projectDescription" : {
    "translation" : "Tic tac ! Une minuterie, c'est bien plus drôle avec Cozmo."
  },
  "codeLabFeaturedProject_FiretruckAlarm.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Lorsque tu appuies sur le drapeau de départ, un compte à rebours de dix secondes commence.\u000a\u000a<span style='font-weight:bold;'>2.</span> À l'issue de celui-ci, l'alarme de Cozmo se déclenche !\u000a\u000a<hr style='background-color:#bbb; color:#bbb; border:none; height:1px'><span style='font-size:80%; font-color:#ddd'>Ce jeu ne nécessite aucun cube.</span>"
  },
  "codeLabFeaturedProject_LightShow.projectName" : {
    "translation" : "Sons et Lumières"
  },
  "codeLabFeaturedProject_LightShow.projectDescription" : {
    "translation" : "Éteins les lumières et profite du groove de la musique."
  },
  "codeLabFeaturedProject_LightShow.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Avant de commencer, <span style='font-weight:bold;'>éteins</span> les lumières.\u000a\u000a<span style='font-weight:bold;'>2.</span> Regarde les cubes de Cozmo effectuer un véritable spectacle de lumière alors qu'il danse sur la musique !"
  },
